        <>
            <main>
                <div className="encabezado">
                    <img className="imghome" src="src\img\logo.png" alt="LogoTNTdevs" />
                    <h4 >Iniciar sesion con:</h4>
                    <button>
                        <img className="imghome" src="src\img\logo.png" alt="LogoGoogle" /> <a href="../Productos_1">Gmail</a>
                    </button>
                </div>
            </main>
        </>
        //
    );
}

export default Home;
